import React from 'react';
import { Link } from 'react-router-dom';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'

const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <Link to={{ pathname: "/", hash: "#about" }}><NavigationButton>About</NavigationButton></Link>
                <Link to={{ pathname: "/", hash: "#experience" }}><NavigationButton>Experience</NavigationButton></Link>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
